import React, { Component } from 'react';
import axios from 'axios'



class Main extends Component {



    constructor(props) {
        super(props)

        this.state= {
            allCourses: []

        }
    }

    componentDidMount(){
        axios.get('https://saral.navgurukul.org/api/courses')
        .then(posRes=>{
            const allCourses = posRes.data.availableCourses
            // console.log(allCourses,"poooooooo")
            this.setState({allCourses:allCourses});
        })
        .catch(errRes=>{
            console.log('errRes')

        })
    }


    render() {
        console.log(this.state.allCourses,"dsahkjfasdkjfkjash")

        return (
            <div>
                <table border='2'>
                <tbody>
                    {this.state.allCourses.map((element)=>{
                        return(
                        <tr style={{width:'50px'}}>
                            <td> {element.name}   <img src={element.logo} size="100px" height="50px"></img></td>

                        </tr>

                    )})}
                </tbody>
                </table>


            </div>
        )
    }
}
 export default Main;
